Marc Dorcel - Legal Appeal (2012) 

For a female lawyer a little uptight, there are cases more complicated than others. First, there is this guy in jail charged of having taken erotic-porn photos of women in the street, not particularly legal. But above all, there is this French young waitress who accuses her boss of sexual harassment. All of this disturb the lawyer and nourishes her fantasies, whereas the one she loves sleeps with her client. Sex in jail, perverted trio, sodomies and facial ejac are haunting her spirit, whereas the waitress, little by little reveals her true nature...

Brooklyn Lee, Eric Swiss, India Summer, Jerry, Katie St. Ives, Lily LaBeau, Liza Del Sierra, Manuel Ferrara, Mark Wood, Xander Corvus

